class Solution:
    def longestRepeating(self, s: str, queryCharacters: str, queryIndices: List[int]) -> List[int]:
        mem = {}
        size = {}
        prev = ':'
        r = []
        # 'babacc'
        # mem['b'] = [[0,1],[2,3]]    size['b'] = [1,1]
        # mem['a'] = [[1,2],[3,4]]    size['a'] = [1,1]
        # mem['c'] = [[4,6]]          size['c'] = [2]
        for v in queryCharacters:
            if v not in mem:
                mem[v] = SortedList()
                size[v] = 0
        for index in range(len(s)):
            if s[index] not in mem:
                mem[s[index]] = SortedList()
                size[s[index]] = 0
            if prev != s[index]:
                if index != 0:
                    mem[prev].add(element)
                    if size[prev] < element[1] - element[0] :
                        size[prev] = element[1] - element[0]
                element = [index,index+1]
            else :
                element[1] = index+1
            prev = s[index]
            # index += 1
        mem[prev].add(element)
        if size[prev] < element[1] - element[0] :
            size[prev] = element[1] - element[0]
        s = list(s)
        # print("ss:",s)
        for (i,v) in enumerate(queryIndices) :
            # remove s[v] index in string
            for start,end in mem[s[v]] :
                if start <= v and v < end:
                    mem[s[v]].remove([start,end])
                    if start != v :
                        mem[s[v]].add([start,v])
                    if v+1 != end :
                        mem[s[v]].add([v+1,end]) 
                    # mem[s[v]].sort()  
                    break
            
            # recalculate s[v]'s size
            m = 0
            for start,end in mem[s[v]] :
                if m < end - start :
                    m = end - start
            size[s[v]] = m
            # size[s[v]] = max(mem[s[v]], key= lambda n: n[1]-n[0])
            
            # vth insert ch
            flag = 1
            ch = queryCharacters[i]   
            for idx in reversed(range(len(mem[ch]))):
                start,end = mem[ch][idx]   # mem[ch] was sorted
                if start-1 == v:
                    mem[ch][idx][0] = start-1
                    if idx != 0 :
                        start1,end1 = mem[ch][idx-1]
                        if end1 == v:
                            mem[ch][idx][0] = start1
                            mem[ch].remove([start1,end1])
                    flag = 0
                    break
                elif end == v:
                    mem[ch][idx][1] = v+1
                    if idx != len(mem[ch])-1 :
                        start1,end1 = mem[ch][idx+1]
                        if start1 == v :
                            mem[ch][idx][1] = end1
                            mem[ch].remove([start1,end1])
                    flag = 0
                    break
            if flag == 1 :
                mem[ch].add([v,v+1])
            # mem[ch].sort()
            m = 0
            for start,end in mem[ch] :
                if m < end - start :
                    m = end - start
            size[ch] = m
            # size[ch] = max(mem[ch], key= lambda n: n[1]-n[0])
            s[v] = ch
            r.append(max(list(size.values())))
        return r

           
def run(s,a,b,expect):
    start = time.time()
    A = Solution()
    r = A.longestRepeating(s,a,b)
    print(" total_time1 : ", time.time() - start , "-> ", end="") 
    
    if r == expect:
        print("SUCCESS -> ",end="")
    else :
        print("ERROR(",expect,") -> ",sep="",end="")
    print(len(s), len(a),len(b) , end="")  
    print()

